import React from 'react'

export default class Home extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            counter: null
        }
    }    

    incrementCounter = () => {
        this.setState({
            counter: this.state.counter +1
        })
    }
      

    render(){
               
        return(
            <div>
            <h1>Artyku≈Çy</h1>
            <button onClick={this.incrementCounter}></button>
            <p>Licznik: {this.counter}</p>
          
            </div>
            
        )
    }
}
